import React, { Component } from 'react';
import classes from './Menu.css';
import MenuItem from './MenuItem/MenuItem';
import Button from '../../Button/Button';

class Menu extends Component {
    
    render () {
        return (
            <ul className={classes.Menu}>
                <MenuItem>
                    <Button />
                </MenuItem>
            </ul>
        );
    }
}

   

export default Menu;
